function sumPrimes(num) {
  let sum = 0;

  const isPrime = numb => {
    for (let i = 2; i < numb; i++) {
      if(numb % i === 0) {
        return false;
      }
    }
    return numb !== 1;
  }

  for (let i = 0; i <= num; i++) {
    if (isPrime(i)) {
      sum += i;
    }
  }
  return sum;
}

sumPrimes(10);
